// src/components/ProjectManagementUses.js

import React from "react";

const ProjectManagementUses = () => {
  return (
    <div>
      <h2 className="text-3xl font-semibold mb-4">Why Project Management is Important</h2>
      <ul className="list-disc pl-6 text-lg text-gray-700">
        <li>Helps to define project goals and objectives clearly.</li>
        <li>Ensures efficient use of resources.</li>
        <li>Helps in tracking progress and staying on schedule.</li>
        <li>Facilitates communication among team members and stakeholders.</li>
        <li>Reduces risks and increases the likelihood of project success.</li>
        <li>Improves client satisfaction and provides transparency.</li>
      </ul>
    </div>
  );
};

export default ProjectManagementUses;
